pragma solidity >=0.4.0 <0.7.0;
import "./User.sol";
import "./Organization.sol";

contract OrganizationList {
    address[] public organizations;

    function createOrganization(
        string memory name,
        string memory id,
        string memory secret
    ) public {
        Organization newOrg = new Organization(name, id, secret);
        organizations.push(address(newOrg));
    }

    //gives you the list of organizations, access each organization by their unique id to call any function
    function getDeployedOrganizations() public view returns (address[] memory) {
        return organizations;
    }
}
